      phi=np.pi/2
      theta = np.linspace(-np.pi, np.pi, 6000)
      ohm = (1/(2*np.pi))* np.exp(- j) * (1 + (np.sqrt(4*np.pi*j) \
            * np.exp(j * (np.cos(theta-phi))**2) *np.cos(theta-phi)) \
            * (1 - q_func(np.sqrt(2*j) * np.cos(theta-phi))))

      ohm=ohm**2
      r = np.linspace(0, 6, 6000)
